// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract CurrentTime {
    // 事件：记录当前时间
    event TimeFetched(uint256 timestamp);

    // 获取当前时间
    function getCurrentTime() external returns (uint256) {
        uint256 currentTime = block.timestamp; 
        emit TimeFetched(currentTime);
        return currentTime;
    }

    function getCurrentTimeView() external view returns (uint256) {
        return block.timestamp;
    }
}

